import React from 'react';
import { user } from '../../actions/user';
import { useDispatch } from 'react-redux';
import { useEffect } from 'react';

export default function Navbar() {
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(user())
    });
    return (
        <div className='Navbar'>
            Navbar
        </div>
    )
}
